Nursery Rhymes - Row Your Boat. Row, row, row your boat, Gently down the stream. Merrily, merrily, merrily, merrily, Life is but a dream. Row, row, row your boat Gently down the stream. If you see a crocodile, Don't forget to scream.&nbsp;

